import { initializeApp } from 'firebase/app';
import { getDatabase } from 'firebase/database';
import { getStorage } from 'firebase/storage';
import { getAuth } from 'firebase/auth';

// For demo purposes, we'll use a simplified config
// In production, you should replace these with your actual Firebase credentials
const firebaseConfig = {
  databaseURL: "https://gymwe-47c13-default-rtdb.asia-southeast1.firebasedatabase.app/",
  projectId: "gymwe-47c13",
  storageBucket: "gymwe-47c13.appspot.com",
  // These are demo values - replace with your actual Firebase config
  apiKey: "demo-api-key",
  authDomain: "gymwe-47c13.firebaseapp.com",
  messagingSenderId: "123456789",
  appId: "demo-app-id"
};

const app = initializeApp(firebaseConfig);
export const database = getDatabase(app);
export const storage = getStorage(app);
export const auth = getAuth(app);
export default app;
